import React from "react";

function Header() {
  return (
    <header>
      <h1>Task Managment</h1>
      <button className="round-button" onClick={() => setShowCreateTask(!showCreateTask)}>
        {showCreateTask ? "-" : "+"}
      </button>
    </header>
  );
}

export default Header;
